// src/pages/NovoDono.jsx
import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../services/api';

export default function NovoDono() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '',
    cpf: '',
    endereco: '',
    dataNascimento: '',
    responsavel: '',
    ativo: true,
    observacoes: '',
  });
  const [errors, setErrors] = useState({});

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm((prev) => ({ ...prev, [name]: type === 'checkbox' ? checked : value }));
    setErrors((prev) => ({ ...prev, [name]: null }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!form.responsavel.trim()) {
      setErrors({ responsavel: 'Responsável é obrigatório' });
      return;
    }

    try {
      await api.post('/donos', form);
      navigate('/donos');
    } catch (err) {
      const resp = err.response?.data;
      if (resp?.erros) {
        const fieldErrors = resp.erros.reduce(
          (acc, cur) => ({ ...acc, [cur.path]: cur.msg }), {}
        );
        setErrors(fieldErrors);
      } else {
        setErrors({ form: resp?.erro || 'Erro ao cadastrar dono' });
      }
    }
  };

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Cadastrar Novo Dono</h2>
        <div>
          <Link to="/" className="btn btn-outline-secondary me-2">Voltar ao Início</Link>
          <Link to="/donos" className="btn btn-secondary">Ver Donos</Link>
        </div>
      </div>

      {errors.form && <div className="alert alert-danger">{errors.form}</div>}

      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label">Nome</label>
          <input name="nome" className="form-control" value={form.nome} onChange={handleChange} required />
          {errors.nome && <div className="text-danger">{errors.nome}</div>}
        </div>

        <div className="mb-3">
          <label className="form-label">CPF</label>
          <input name="cpf" className="form-control" value={form.cpf} onChange={handleChange} required />
          {errors.cpf && <div className="text-danger">{errors.cpf}</div>}
        </div>

        <div className="mb-3">
          <label className="form-label">Endereço</label>
          <input name="endereco" className="form-control" value={form.endereco} onChange={handleChange} required />
          {errors.endereco && <div className="text-danger">{errors.endereco}</div>}
        </div>

        <div className="mb-3">
          <label className="form-label">Data de Nascimento</label>
          <input type="date" name="dataNascimento" className="form-control" value={form.dataNascimento} onChange={handleChange} />
          {errors.dataNascimento && <div className="text-danger">{errors.dataNascimento}</div>}
        </div>

        <div className="mb-3">
          <label className="form-label">Responsável</label>
          <input name="responsavel" className="form-control" value={form.responsavel} onChange={handleChange} required />
          {errors.responsavel && <div className="text-danger">{errors.responsavel}</div>}
        </div>

        <div className="form-check mb-3">
          <input className="form-check-input" type="checkbox" name="ativo" checked={form.ativo} onChange={handleChange} />
          <label className="form-check-label">Ativo</label>
        </div>

        <div className="mb-3">
          <label className="form-label">Observações</label>
          <textarea name="observacoes" className="form-control" rows="3" value={form.observacoes} onChange={handleChange} />
        </div>

        <button type="submit" className="btn btn-primary">Cadastrar Dono</button>
      </form>
    </div>
  );
}
